import React, { Component } from "react";
import './App.css';
import create from './backend/models/create'




class App extends Component {

  state ={ create:[]}

  componentDidMount(){
    fetch('/')
    .then(res => res.json())
    .then(create => this.setState({create}));
  }



  render(){
    return (
      <div>

        <h1>Create New Card</h1>
        {this.state.create.map(create =>
          <div key={create.id}>{create.username}</div>
          )}

      </div>
    )
  }
}

export default App;
